import React from "react";

export default function Login() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-4 justify-content-end">
          <p>Loin</p>
          <input type="username" placeholder="Username"/>
          <input type="password" placeholder="Password"/>
          <button>Login</button>
        </div>
      </div>
    </div>
  )
}
